import React from "react";

function Home() {
  return (
    <>
      <div className="unlogged-nav-bar">
        <div className="nav-button empty"><p>Log In</p></div>
        <div className="nav-button filled"><p>Sign Up</p></div>
        <div className="nav-icon settings"><i class="fa fa-cog" aria-hidden="true"></i></div>
      </div>
      <h1>The Forest</h1>
      <div className="nav-button empty"><p>About</p></div>
    </>
  )
}

export default Home
